import TaskForm from './TaskForm';
import '../css/TaskList.css';

function TaskList() {
    return (
        <>
        <TaskForm></TaskForm>
        <div className='TaskListContainer'>
            Lista de Tareas
        </div>
        </>
    );
}

export default TaskList ;
